      { name: 'UR10', points: [{ x: 3, y: 5, z: 3 }, { x: 3, y: 8, z: 0 }], capturedBy: 'Abdul Moazzam' },
      { name: 'UR3', points: [{ x: 3, y: 5, z: 3 }, { x: 3, y: 8, z: 0 }], capturedBy: 'Adeel' },
    ]

}


